插入1000筆會員資料 PROCEDURE
DELIMITER $$
CREATE PROCEDURE creatuserinfo1000(n int)
BEGIN

set @i=1;
	while @i<=n do 
    	INSERT INTO `userinfo` (`u_id`, `u_name`, `u_img`) VALUES (NULL, concat('賴小凱',@i), );
		
        set @i=@i+1;
end while;

END $$

//呼叫procedure

call creatuserinfo1000(1000)

//插入100筆商品資料
DELIMITER $$
CREATE PROCEDURE creatcommodity1000(n int)
BEGIN

set @i=1;
	while @i<=n do
	INSERT INTO `commodityinfo` (`c_id`, `c_name`, `c_img`) VALUES (NULL, concat('商品',@i), );
    set @i = @i+1;
    
    end WHILE;
    
END $$

//呼叫 creatuserinfo1000(100) 

CALL creatuserinfo1000(100)

//交易資料表: 3000+組
DELIMITER $$
CREATE PROCEDURE crearandtime1(n int)
BEGIN


set @i = 1;
WHILE @i<=n DO
		INSERT INTO `transactioninfo` (`t_id`, `u_id`, `t_time`) VALUES (NULL,cast(ceiling(rand() * 1000) as int),concat('2018-',cast(ceiling(rand() * 12) as int),'-',cast(ceiling(rand() * 28) as int),' ',cast(ceiling(rand() * 24) as int),':',cast(ceiling(rand() * 60) as int),':',cast(ceiling(rand() * 60) as int)));
        set @i = @i+1;
end WHILE;
END $$

//呼叫創立隨機訂單
call crearandtime1(3000)




